import React, { Component } from 'react'

import { Link } from 'react-router-dom'

const links = [
    {to: '/', label: 'Моя страница', exact: true },
    {to: '/my_message', label: 'Мои сообщения', exact: false},
    {to: '/my_friends', label: 'Мои друзья', exact: false},
    {to: '/logout', label: 'Выйти', exact: false},
];

class MainFunctionBar extends Component {

    renderLinks() {
        return links.map((link, index) => {
            return(
                <li key={index}>
                    <Link
                        to={link.to}
                    >
                    {link.label}
                    </Link>
                </li>
            )
        })
    }
    render() {
        return(
            <nav>
                <ul>
                    { this.renderLinks() }
                </ul>
            </nav>
        )
    }

}

export default MainFunctionBar
